import React, { useState } from "react";
import "../styles/Dashboard.css";
import PsychologistDashboard from "./PsychologistDashboard";
import PsychiatristDashboard from "./";

const features = [
  { text: "View Reports", icon: "ðŸ“„", bg: "reports.jpg" },
  { text: "Call & Recordings", icon: "ðŸ“ž", bg: "calls.jpg" },
  { text: "Book Appointment", icon: "ðŸ“…", bg: "appointment.jpg" },
  { text: "Play Games and Tests", icon: "ðŸŽ®", bg: "games.jpg" },
  { text: "Make Friends for Support", icon: "ðŸ‘«", bg: "friends.jpg" },
  { text: "View Medications", icon: "ðŸ’Š", bg: "medications.jpg" },
];

const UserDashboard = () => {
  const [showAppointmentPopup, setShowAppointmentPopup] = useState(false);
  const [username, setUsername] = useState("");
  const [appointments, setAppointments] = useState({ psychologists: [], psychiatrists: [] });

  const handleBookAppointment = (type) => {
    if (!username) {
      alert("Please enter your username before booking an appointment.");
      return;
    }
    setAppointments((prev) => ({
      ...prev,
      [type]: [...prev[type], username],
    }));
    alert(`Appointment booked with a ${type === "psychologists" ? "Psychologist" : "Psychiatrist"}`);
    setShowAppointmentPopup(false);
  };

  return (
    <div className="dashboard-container">
      <h2>User Dashboard</h2>
      <input
        type="text"
        placeholder="Enter your username"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
        className="username-input"
      />
      <button className="submit-button" onClick={() => setShowAppointmentPopup(true)}>
        Book Appointment
      </button>
      {showAppointmentPopup && (
        <div className="popup">
          <h3>Book an Appointment</h3>
          <button onClick={() => handleBookAppointment("psychologists")}>Psychologist</button>
          <button onClick={() => handleBookAppointment("psychiatrists")}>Psychiatrist</button>
          <button onClick={() => setShowAppointmentPopup(false)}>Close</button>
        </div>
      )}
      <PsychologistDashboard appointments={appointments} />
      <PsychiatristDashboard appointments={appointments} />
    </div>
  );
};

export default UserDashboard;
